import { useEffect, useMemo, useState } from "react";
import api from "../services/api";

type Category = "demographic" | "health" | "financial";

type Question = {
  id: number;
  title: string;
  description?: string;
  type: string;
  category: Category;
};

type ResponseItem = {
  id: number;
  userId: number;
  questionId: number;
  answer: string;
  question: Question;
  createdAt?: string; // if your API adds this later
};

export default function Responses() {
  const [rows, setRows] = useState<ResponseItem[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const [category, setCategory] = useState<"" | Category>("");

  useEffect(() => {
    (async () => {
      try {
        const res = await api.get<ResponseItem[]>("/responses/me");
        setRows(res.data || []);
      } catch (e) {
        console.error(e);
        setError("Failed to load responses.");
      } finally {
        setLoading(false);
      }
    })();
  }, []);

  // Deduplicate by questionId (keep the latest by highest response.id as a proxy)
  const deduped = useMemo(() => {
    const byQ = new Map<number, ResponseItem>();
    for (const r of rows) {
      const existing = byQ.get(r.questionId);
      if (!existing || r.id > existing.id) byQ.set(r.questionId, r);
    }
    let list = Array.from(byQ.values());
    if (category) list = list.filter((r) => r.question?.category === category);
    // Stable sort: category, then question title
    return list.sort((a, b) => {
      const ca = a.question?.category || "";
      const cb = b.question?.category || "";
      if (ca !== cb) return ca.localeCompare(cb);
      return (a.question?.title || "").localeCompare(b.question?.title || "");
    });
  }, [rows, category]);

  if (loading) return <div className="p-4">Loading your responses...</div>;
  if (error) return <div className="p-4 text-red-600">{error}</div>;

  return (
    <div className="max-w-5xl mx-auto p-4">
      <div className="mb-4 flex items-center gap-3">
        <h1 className="text-2xl font-semibold">Your Survey Responses</h1>
        <div className="ml-auto flex items-center gap-2">
          <label className="text-sm text-gray-600">Category</label>
          <select
            className="border rounded px-2 py-1"
            value={category}
            onChange={(e) => setCategory(e.target.value as any)}
          >
            <option value="">All</option>
            <option value="demographic">Demographic</option>
            <option value="health">Health</option>
            <option value="financial">Financial</option>
          </select>
        </div>
      </div>

      <div className="overflow-x-auto border rounded">
        <table className="min-w-full text-sm">
          <thead className="bg-gray-50">
            <tr>
              <th className="text-left px-3 py-2 font-medium text-gray-700 w-24">Category</th>
              <th className="text-left px-3 py-2 font-medium text-gray-700">Question</th>
              <th className="text-left px-3 py-2 font-medium text-gray-700">Description</th>
              <th className="text-left px-3 py-2 font-medium text-gray-700 w-64">Answer</th>
              <th className="text-left px-3 py-2 font-medium text-gray-700 w-40">Updated</th>
            </tr>
          </thead>
          <tbody>
            {deduped.length === 0 ? (
              <tr>
                <td colSpan={5} className="px-3 py-4 text-gray-500">
                  No responses found.
                </td>
              </tr>
            ) : (
              deduped.map((r, idx) => (
                <tr key={r.id} className={idx % 2 ? "bg-white" : "bg-gray-50/50"}>
                  <td className="px-3 py-2 capitalize">{r.question?.category}</td>
                  <td className="px-3 py-2">{r.question?.title}</td>
                  <td className="px-3 py-2 text-gray-600">{r.question?.description || "-"}</td>
                  <td className="px-3 py-2 break-words">{r.answer || "-"}</td>
                  <td className="px-3 py-2 text-gray-600">
                    {r.createdAt ? new Date(r.createdAt).toLocaleString() : "â€”"}
                  </td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}
